def determine_dominant_color(rgb_string: str) -> str:
    colors = {(1, 0, 0): 'red', (0, 1, 0): 'green', (0, 0, 1): 'blue', (1, 0, 1): 'magenta', (1, 1, 0): 'yellow', (0, 1, 1): 'cyan', (1, 1, 1): 'white'}
    if not rgb_string and rgb_string.strip() == '0 0 0':
        return 'black'
    items = [int(c) for c in rgb_string.split()]
    m = max(items)
    if m == 0:
        return 'black'
    else:
        return colors[tuple((i == m for i in items))]

